import React from "react";
import "./Navbar.css";
import logo from './logo.png';
import { NavLink } from 'react-router-dom';

export default function Navbar({ role, onLogout }) {
    return (
        <div className="navbar">
            <div className="logo">
                <img src={logo} alt="Artistry-Hub Logo" />
            </div>
            <ul>
                <li><NavLink to="/" exact activeClassName="active">Home</NavLink></li>
                
                {/* Common Links */}
                {role !== 'admin' && (
                    <li><NavLink to="/find-artist" activeClassName="active">Find Artist</NavLink></li>
                )}
                <li><NavLink to="/blogs" activeClassName="active">Blogs</NavLink></li>
                <li><NavLink to="/about" activeClassName="active">About</NavLink></li>
                <li><NavLink to="/services" activeClassName="active">Services</NavLink></li>

                {/* Role-Specific Links */}
                {role === 'user' && (
                    <>
                        <li><NavLink to="/user-dashboard" activeClassName="active">Dashboard</NavLink></li>
                        <li><NavLink to="/my-orders" activeClassName="active">My Orders</NavLink></li>
                    </>
                )}
                {role === 'artist' && (
                    <>
                        <li><NavLink to="/artist-dashboard" activeClassName="active">Artist Dashboard</NavLink></li>
                        <li><NavLink to="/my-services" activeClassName="active">My Services</NavLink></li>
                    </>
                )}
                {role === 'admin' && (
                    <>
                        <li><NavLink to="/admin-dashboard" activeClassName="active">Admin Dashboard</NavLink></li>
                        <li><NavLink to="/manage-users" activeClassName="active">Manage Users</NavLink></li>
                        <li><NavLink to="/manage-services" activeClassName="active">Manage Services</NavLink></li>
                    </>
                )}

                {/* Conditionally Render Login or Logout */}
                {role ? (
                    <li>
                        <NavLink to="/" onClick={onLogout}>Logout</NavLink>
                    </li>
                ) : (
                    <li>
                        <NavLink to="/login" activeClassName="active">Login</NavLink>
                    </li>
                )}
            </ul>
            <div className="search-container">
                <input type="text" placeholder="Search..." />
                <button type="submit">Search</button>
            </div>
        </div>
    );
}
